import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';
import { ScatterChart, Scatter, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

const App = () => {
    const [xMin, setXMin] = useState('');
    const [xMax, setXMax] = useState('');
    const [yMin, setYMin] = useState('');
    const [yMax, setYMax] = useState('');
    const [numPoints, setNumPoints] = useState('');
    const [timeMin, setTimeMin] = useState('');
    const [timeMax, setTimeMax] = useState('');
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [entities, setEntities] = useState([]);

    useEffect(() => {
        const intervalId = setInterval(() => {
            setData(prevData =>
                prevData
                    .map(item => ({ ...item, seconds: item.seconds - 1 }))
                    .filter(item => item.seconds > 0)
                    .sort((a, b) => b.seconds - a.seconds));
        }, 1000);

        return () => clearInterval(intervalId);
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();

        const xMinNum = parseInt(xMin);
        const xMaxNum = parseInt(xMax);
        const yMinNum = parseInt(yMin);
        const yMaxNum = parseInt(yMax);
        const numPointsNum = parseInt(numPoints);
        const timeMinNum = parseInt(timeMin);
        const timeMaxNum = parseInt(timeMax);

        if (isNaN(xMinNum) || isNaN(xMaxNum) || isNaN(yMinNum) || isNaN(yMaxNum) || isNaN(numPointsNum) || isNaN(timeMinNum) || isNaN(timeMaxNum)) {
            setError('All fields must be numbers');
            return;
        }

        const newData = Array.from({ length: numPointsNum }, (_, index) => ({
            x: Math.floor(Math.random() * (xMaxNum - xMinNum + 1)) + xMinNum,
            y: Math.floor(Math.random() * (yMaxNum - yMinNum + 1)) + yMinNum,
            seconds: Math.floor(Math.random() * (timeMaxNum - timeMinNum + 1)) + timeMinNum
        }));

        setData(newData);
        setLoading(false);
    };

    const fetchData = async () => {
        setLoading(true);
        try {
            const response = await axios.get('http://localhost:5001/data');
            setData(response.data);
            setLoading(false);
        } catch (error) {
            setError('Error fetching data');
            setLoading(false);
        }
    };

    useEffect(() => {
        axios.get('http://localhost:5001/array')
            .then((response) => {
                setEntities(response.data.entities);
            })
            .catch((error) => {
                console.error('Error fetching entities:', error);
            });
    }, []);

    const isLocked = data.length > 0;

    return (
        <div className="app-container">
            <h1>RGraph</h1>

            <div className="horizontal-container">
                <div className={`input-container ${isLocked ? 'locked' : ''}`}>
                    <form onSubmit={handleSubmit}>
                        <div className="input-group">
                            <label>X Min:</label>
                            <input type="number" value={xMin} onChange={e => setXMin(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>X Max:</label>
                            <input type="number" value={xMax} onChange={e => setXMax(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Y Min:</label>
                            <input type="number" value={yMin} onChange={e => setYMin(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Y Max:</label>
                            <input type="number" value={yMax} onChange={e => setYMax(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Number of Points:</label>
                            <input type="number" value={numPoints} onChange={e => setNumPoints(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Time Min:</label>
                            <input type="number" value={timeMin} onChange={e => setTimeMin(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Time Max:</label>
                            <input type="number" value={timeMax} onChange={e => setTimeMax(e.target.value)} />
                        </div>
                        <button type="submit">Generate Data</button>
                    </form>
                    {loading && <p>Loading...</p>}
                    {error && <p style={{ color: 'red' }}>{error}</p>}
                </div>

                <div className="scroll-container">
                    <h2>MongoDB Entities</h2>
                    {entities
                        .slice()
                        .sort((a, b) => {
                            const dateA = new Date(a["runtime:"].split('-').reverse().join('-'));
                            const dateB = new Date(b["runtime:"].split('-').reverse().join('-'));
                            return dateB - dateA;
                        })
                        .map((entity) => (
                            <div key={entity._id} className="entity-item">
                                <p>{entity["runtime:"]}</p>
                            </div>
                        ))}
                </div>

                <div className="data-table-container">
                    <h2>Data Table</h2>
                    <table className="data-table">
                        <thead>
                            <tr>
                                <th>X</th>
                                <th>Y</th>
                                <th>Time (seconds)</th>
                            </tr>
                        </thead>
                        <tbody>
                            {data.map((item, index) => (
                                <tr key={index}>
                                    <td>{item.x}</td>
                                    <td>{item.y}</td>
                                    <td>{item.seconds}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>

                <div className="chart-container">
                    <ScatterChart width={600} height={400}>
                        <CartesianGrid />
                        <XAxis dataKey="x" name="X" unit="" />
                        <YAxis dataKey="y" name="Y" unit="" />
                        <Tooltip />
                        <Scatter name="Data Points" data={data} fill="#8884d8" />
                    </ScatterChart>
                </div>
            </div>

            {/* קונטיינר עבור MongoDB */}
            <div className="mongodb-container">
                <h2>MONGODB</h2>
                {/* תוכן MongoDB */}
            </div>
        </div>
    );
};

const CustomizedDot = (props) => {
    return (
        <svg>
            <circle cx={props.cx} cy={props.cy} r={10} fill="#00C49F" stroke="white" strokeWidth={2} />
        </svg>
    );
};

export default App;
